import React from 'react';


function Text(){
    return(
        <p>Graphics and web design fuse creativity with functionality, crafting visually compelling and user-friendly digital experiences. In graphics, artists play with color and form to communicate messages, while web designers focus on creating seamless online journeys through intuitive layouts and interactive elements. Together, they shape the visual landscape of the digital realm, transforming ideas into captivating visuals and user interfaces.</p>
    );
}

export default Text;
